import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import './ScheduleSection.css';

const ScheduleSection = () => {
  const [ref, inView] = useInView({
    threshold: 0.2,
    triggerOnce: true
  });

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        delayChildren: 0.3,
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { x: -50, opacity: 0 },
    visible: {
      x: 0,
      opacity: 1,
      transition: {
        duration: 0.8,
        ease: "easeOut"
      }
    }
  };

  const scheduleData = [
    {
      day: "Day 1",
      title: "Inspiration",
      date: "March 15, 2025",
      events: [
        { time: "9:00 AM", event: "Registration & Welcome", icon: "üéØ" },
        { time: "10:00 AM", event: "Opening Ceremony", icon: "üé§" },
        { time: "11:00 AM", event: "Keynote: Tech for Good", icon: "üí°" },
        { time: "12:00 PM", event: "Team Formation", icon: "ü§ù" },
        { time: "1:00 PM", event: "Lunch & Networking", icon: "üçΩÔ∏è" },
        { time: "2:00 PM", event: "Ideation Workshops", icon: "üß†" },
        { time: "6:00 PM", event: "Pitch Your Ideas", icon: "üéØ" },
        { time: "8:00 PM", event: "Dinner & Socializing", icon: "üéâ" }
      ],
      color: "var(--primary-indigo)"
    },
    {
      day: "Day 2",
      title: "Creation",
      date: "March 16, 2025",
      events: [
        { time: "8:00 AM", event: "Breakfast & Energizers", icon: "‚òï" },
        { time: "9:00 AM", event: "Hack Time Begins!", icon: "üíª" },
        { time: "12:00 PM", event: "Lunch Break", icon: "ü•™" },
        { time: "1:00 PM", event: "Mentor Check-ins", icon: "üë•" },
        { time: "3:00 PM", event: "Workshop: UI/UX Design", icon: "üé®" },
        { time: "6:00 PM", event: "Dinner Break", icon: "üçï" },
        { time: "7:00 PM", event: "Continued Development", icon: "‚ö°" },
        { time: "11:00 PM", event: "Late Night Snacks", icon: "üåô" }
      ],
      color: "var(--accent-coral)"
    },
    {
      day: "Day 3",
      title: "Celebration",
      date: "March 17, 2025",
      events: [
        { time: "9:00 AM", event: "Final Sprint", icon: "üèÉ" },
        { time: "12:00 PM", event: "Submission Deadline", icon: "üì§" },
        { time: "1:00 PM", event: "Lunch & Prep", icon: "üé™" },
        { time: "2:00 PM", event: "Project Presentations", icon: "üé§" },
        { time: "4:00 PM", event: "Judging & Deliberation", icon: "‚öñÔ∏è" },
        { time: "5:00 PM", event: "Awards Ceremony", icon: "üèÜ" },
        { time: "6:00 PM", event: "Closing & Networking", icon: "üéä" },
        { time: "7:00 PM", event: "After Party", icon: "üéâ" }
      ],
      color: "var(--highlight-emerald)"
    }
  ];

  return (
    <section className="schedule-section section" id="schedule">
      <div className="container">
        <motion.div 
          ref={ref}
          className="schedule-content"
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
        >
          <motion.h2 className="section-title" variants={itemVariants}>
            Event Schedule
          </motion.h2>

          <div className="timeline">
            {scheduleData.map((day, index) => (
              <motion.div 
                key={index} 
                className="timeline-item"
                variants={itemVariants}
              >
                <div className="timeline-marker" style={{ backgroundColor: day.color }}>
                  <span className="day-number">{index + 1}</span>
                </div>

                <div className="timeline-content">
                  <div className="day-card">
                    <div className="day-header">
                      <h3 className="day-title">{day.title}</h3>
                      <p className="day-subtitle">{day.day}</p>
                      <p className="day-date">{day.date}</p>
                    </div>

                    <div className="events-list">
                      {day.events.map((event, eventIndex) => (
                        <div key={eventIndex} className="event-item">
                          <div className="event-icon">{event.icon}</div>
                          <div className="event-details">
                            <div className="event-time">{event.time}</div>
                            <div className="event-name">{event.event}</div>
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>

                {index < scheduleData.length - 1 && (
                  <div className="timeline-connector"></div>
                )}
              </motion.div>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default ScheduleSection;
